std::string markdown_to_html(const std::string& markdown_text) {
    pandoc::Reader reader;
    pandoc::Document doc;
    try {
        reader.push_back(markdown_text);
        reader.read(doc);
        pandoc::Walker walker(doc);
        std::string html_text;
        walker.walk([&html_text](pandoc::Strong emsg) {
